import React from 'react'

export default function Signup() {
  const hanelSubmit = (e)=>{
    e.preventDefault();
  }
  return (
    <div className='w-100 d-flex justify-content-center align-items-center ' style={{height:"100vh"}}>
<form onSubmit={hanelSubmit} className='form-group w-50'>
  <label htmlFor="useName" className='form-check-label'>userName</label>
  <input type="text" placeholder='userName' className='form-control' id='useName' />

  <label htmlFor="userEmail" className='form-check-label'>email</label>
  <input type="email" placeholder='email@email.com' className='form-control' id='userEmail' />

  <label htmlFor="useName" className='form-check-label'>userName</label>
  <input type="text" placeholder='userName' className='form-control' id='useName' />








</form>
    </div>
  )
}
